import React, { useState } from 'react';
import './EditProfile.css'; // Import the CSS file

function EditProfile() {
  const [formData, setFormData] = useState({
    username: '',
    email: '',
    profileImage: ''
  });
  const [errorMessage, setErrorMessage] = useState('');

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSaveProfile = () => {
    // Replace with your save profile logic
    console.log('Saving profile data:', formData);
  };

  return (
    <div className="login_container">
      <div className="login_form_container">
        <div className="left">
          <div className="form_container">
            <h1>Edit Profile</h1>
            {errorMessage && <div className="error_msg">{errorMessage}</div>}
            <input
              type="text"
              name="username"
              placeholder="Username"
              className="input"
              value={formData.username}
              onChange={handleInputChange}
            />
            <input
              type="email"
              name="email"
              placeholder="Email"
              className="input"
              value={formData.email}
              onChange={handleInputChange}
            />
            <input
              type="text"
              name="profileImage"
              placeholder="Profile Image URL"
              className="input"
              value={formData.profileImage}
              onChange={handleInputChange}
            />
            <button className="green_btn" onClick={handleSaveProfile}>Save</button>
          </div>
        </div>
        <div className="right">
          <h1>Profile</h1>
          {/* You can add a preview of the profile image or any other relevant information here */}
        </div>
      </div>
    </div>
  );
}

export default EditProfile;
